def check_for_updates(metadata_file):
    '''V√©rifie les mises √† jour sur GitHub.'''
    try:
        with open(metadata_file) as f:
            local_meta = json.load(f)
        
        response = requests.get(f"{GITHUB_BASE_URL}{os.path.basename(metadata_file)}")
        if response.status_code == 200:
            remote_meta = response.json()
            if remote_meta["version"] > local_meta["version"]:
                print(f"üîÑ Version {remote_meta['version']} disponible (votre version: {local_meta['version']})")
                return True
    except Exception as e:
        print(f"‚ö†Ô∏è Erreur de v√©rification: {e}")
    return False

